import React from 'react'

const Today = ({ day, daily }) => {

  return (
    <div className="container">
      <div className="row">
        <span>{day}</span>
        <span>{daily.data !== undefined ? console.log(daily.data[1]) : null}</span>
        <span></span>
      </div>

    </div>
  )
}

export default Today
